import React, { useRef, useState, useEffect } from "react";
import { Redirect } from 'react-router';
import { Header } from "../../common/Header";
import {
    MDBBtn,
    MDBFreeBird,
    MDBCard,
    MDBCardBody,
    MDBCardImage,
    MDBCardText,
    MDBCol,
    MDBContainer,
    MDBFormInline,
    MDBIcon,
    MDBInput,
    MDBRow,
    MDBTable,
    MDBTableBody,
    MDBTableHead,
    MDBEdgeHeader,
    MDBCardTitle,
    MDBProgress
} from "mdbreact";
import { useHistory } from "react-router";
import "./style.css"

export const Home = (props: any) => {
    console.log(props)
    if (props.User === undefined) {
        return <Redirect to={{
            pathname: '/login',
        }} />
    }

    return (
        <>
            <MDBContainer fluid>
                <MDBRow>
                <p className='text-dark' style={{ fontSize: "20px" }}>Dashboard 
                                    <span className='text-light' style={{ fontSize: "12px", marginLeft: "10px" }}>www.sampleapplication.com</span></p>
                </MDBRow>

            </MDBContainer>
        </>
    )
}
